import React from 'react';
import './App.css';
import logo from '../assets/ecilnewlogo.jpg'; // Make sure this path is correct

function TopBar() {
  return (
    <div className="container-fluid bg-primary text-white py-2">
      <div className="row align-items-center">
        <div className="col-auto">
          <img src={logo} alt="logo" height="60" width="60" />
        </div>
        <div className="col text-center">
          <h5 className="mb-0">Extraneous Manpower Management System</h5>
          <h6 className="mb-0">Electronics Corporation Of India Limited</h6>
        </div>
      </div>
    </div>
  );
}

export default TopBar;
